response.about:
Мы проводим праздники для детей от 3 до 12 лет;
Продолжительность праздника - 2 часа;
В программу входят:праздник по сценарию со сказочными персонажами,торжественное поздравление именинника,праздничный пир,танцевальные игры,дискотека;
Мы можем написать индивидуальный сценарий для именинника и его друзей;
Наш уютный и просторный зал разместит до 30 детей;
Родители имеют прекрасную возможность во время праздника пообщаться друг с другом за круглым праздничным столом;
Вы можете заказать у нас именинный пирог
